import React from 'react'; 
import Head from 'next/head';
import PropTypes from 'prop-types';
import AppLayout from '../components/AppLayout';

const DigitalGallery = ({ Component }) =>{
    return (
        <> 
        <Head>
            <title>Degital Gallery</title>
           {/* <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/antd/4.5.2/antd.compact.min.css"/> */}
           <link rel="canonical" href="https://material-ui.com/premium-themes/paperbase/"></link>
           <link rel="alternate" href="https://material-ui.com/premium-themes/paperbase/" hreflang="x-default"></link>
           <link href="https://fonts.gstatic.com" rel="preconnect" crossorigin="anonymous" />
           <link rel="stylesheet" href="https://fonts.googleapis.com/css?family=Roboto:300,400,500,700&display=swap" />
           <link rel="stylesheet" href="https://fonts.googleapis.com/icon?family=Material+Icons" />
           <script src=" https://unpkg.com/@material-ui/core@latest/umd/material-ui.development.js"></script>
          
        </Head>
        <AppLayout>
            <Component />
        </AppLayout>
        </>
    );
}

DigitalGallery.propTypes = {
    component: PropTypes.elementType, 
}

export default DigitalGallery;
